import React, { useState } from "react";
import { HeroContainer, LeftArrow, RightArrow } from "./HeroElements";
import Slide from "../Slide";
import cosmog from "../../assets/images/cosmog.png";
import corsola from "../../assets/images/corsola.png";
import bewear from "../../assets/images/bewear.png";
import arrLeft from "../../assets/images/arrw-l.png";
import arrRight from "../../assets/images/arrw-r.png";

const Hero = () => {
  const [current, setCurrent] = useState(0);
  const slideLength = 3;
  return (
    <HeroContainer>
      <Slide
        img={cosmog}
        number="#789"
        name="Cosmog"
        kanji="コスモッグ"
        bgColor="EEEC7F"
      />
      <Slide
        img={corsola}
        number="#864"
        name="Corsola"
        kanji="サニーゴ"
        bgColor="8F8F90"
      />
      <Slide
        img={bewear}
        number="#760"
        name="Bewear"
        kanji="キテルグマ"
        bgColor="8F8F90"
      />
      <LeftArrow arrow={arrLeft} />
      <RightArrow arrow={arrRight} />
    </HeroContainer>
  );
};

export default Hero;
